INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (161790,"مان ترکويق دجاهيت دتمڤوڠ،","بومي دڤيجق لاڠيت دجونجوڠ؛","ايندهڽ شوال باليق کامڤوڠ،","جومڤا ساودارا ساليڠ برکونجوڠ.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (161791,"لمڠ کتوڤت تڤوڠ ڤليتا،","اءير سيرڤ dihidang جوݢ؛","ڤوهون امڤون معاف دڤينتا،","ايندهڽ شوال براي سکلوارݢ.", 4, 6);
