INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164917,"اديق مماکاي کباي سوڠکيت","ابڠ برسمڤيڠ کريس د ڤيڠݢڠ","لڠکه دأتور تاري dimula","سکق ݢايڽ سني بودايا", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164918,"اديق nyedi سکق tepelinges","تياڠ بويق jangke ڤيتيڠ","Dendeq ناڠيس dedare inges","Lemaq kelem gengku داتڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164919,"اديق ڤولڠ سبلوم سنجا","لڤس صلاة ڤرݢي مڠاجي","اوسه مݢه مندابيق دادا","علمو باڽق بلوم تراوجي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164920,"اديق ساي سأورڠ ڤرمڤوان","برصحابت دڠن انق ڤق Hassan","تيليفون جوݢ ساتو کڤرلوان","امت برݢونا سماس کچمسن", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164921,"اديق-براديق منبڠ برتم","کاڤق تاجم دري بليوڠ","جاݢوڠ دڤتيق ڤادي دکتم","بلوم هوجن سوده برڤايوڠ؟", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164922,"اديقڽ ايڤر اوليه بݢيندا","اورڠ مڠادڤ ستياڤ هاري","اياله دݢلر راج مودا","دسرهکن تتڤ ڤمرينتهن نݢري", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164923,"عاديل سماس ڤݢڠ کواس","صلاة وقتو تتڤ برجماعه","ماتي داتڠ بيلا‌٢ ماس","ايلوق جک تڠه bertazkirah", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164924,"اديڤاتي مماکاي سوڠکوق","ممباوا اڠسان دالم ڤراهو","مت Jenin ماتي جاتوه ڤوکوق","قيصه ميمڤيڽ سياڤا يڠ تاهو؟", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164925,"Aditiawarman سي راج Minang","راج عاديل دتڤتي","توجوه معرفة سوده kupandang","تيدق برتوکر د دالم هاتي.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164926,"Ado bakiaik caro mamanciang","Taukkan tuo اومڤن بادا","Hibo diadaik katagiliang","Turuikan ماله ڤوترن رودا.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164927,"Ado kalonyo راجين د pangka","Putuih parkaro تق ڤاي لاي","د اورڠ putuih اوق له tingga tahia ameh","Tahia ameh تق اورڠ باري", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164928,"Ado کاسيهنله جقسا کامي","توان ترسبوت سوڠݢوه براني","ڤݢڠ جاوتن دڠن ستيا","منولوڠ توانله Kompania", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164929,"Adong do مانوق mira","Potek-potek مانوق kulabu","توا مي ma مارينا","Manjou-jou sian جابو", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164930,"ادو برادو ڤريوق belangan","لکر ترݢوليڠ د باوه تيڠکڤ","ترسدو-سدو بروق د ريمبا","مندڠر کمبيڠ ممباچ کتاب", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164931,"ادو kutanam ڤوهون کلادي","بارڠن بواه کتايا.","اد کو coba برتانم بودي","اورڠ اڠݢن apakan داي.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164932,"ادوه! توان‌٢ Albrech & چو. مودا بستاري","اڠکاو جوݢ سوده کو چاري","جادي ڤڠهيبور دالم هاتيکو","د دالم هيدوڤ hari-hariku", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164933,"ادوهاي ڤوترا ادوهاي توان","چارا اڤ سوده ک ماري","دڠن سوڽي ماسوق labuan","ڤد ڤتڠ ستڠه هاري", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164934,"ادوهاي سلاسيه نݢري China","Jantong ممباوا نݢري Melilin","واهاي kekaseh جاڠن betanya","Untong dibawak ديري ميسکين", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164935,"Adui لانڠ بلادو لانڠ","لانڠ جونتاين سي تالي بنڠ","بوکن مابوق کران ڤينڠ","مابوق کران سي انق اورڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164936,"ادون تڤوڠ سوجي","بوات ڤوتو کوءيه دادر","برلابون تڠه مڠاجي","هيلڠ وقتو حرام کوق سدر", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164937,"اݢق ka سوده tabangkalai","بيمبڠ jo راݢو نن manimpo","Sabab ديک يقين تق دڤاکاي","Indak salasai apo karajo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164938,"اݢر هيدوڤ ترڠ-بندرڠ","ايتوله بقتي تينتا دان ڤنا","منجادي کاجين اورڠ سکارڠ","جاسڽ ايت تيدق فناء", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164939,"اݢر سݢالا اورڠ مندڠر","باءيق د سيني باءيق د سان","Pri دان hadat کاڤيتن امبون","کاڤيتن امبون جوݢ ترڤوجي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164940,"اݢر اوسها براوليه برکة","حاصيل مليمڤه اونتوڠ برليڤت","ڤادي berkepuh ڤنوه دان ڤادت","منڤوڠ تاور سلالو دبوات", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164941,"اݢر٢ مانيس مادو","جمور د ڤاڤس لالو bersakar","تياد تمڤت هندق مڠادو","امس برچمبه دالم بلوکر", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164942,"Agik دولوق مندي د pait","تاڤي سکارڠ مندي د pegung","Agik دولوق روکوق segeret","تاڤي سکارڠ berokok اڤوڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164943,"Aguang rajo ba-bunyi مالم","اورڠ ma-marik alaman-nyo","Untuang sayo wallahu-alam","Sakik jo sanang di-tangguang-Nyo.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164944,"Aguang sambuik bawo naiak","Jatuah batimpo باله ampek","Untuang سورتن نن تق baiak","لاءين دچاري لاءين dapek", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164945,"ݢوڠ سمبوتن باوا ناءيق","جاتوه برتيمڤا بله امڤت","اونتوڠ سورتن يڠ تق باءيق","لاءين دچاري لاءين يڠ داڤت", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164946,"Aguang sambuyan bawok naiek","Kudo ba-lari masuak kampuang","Untuang سورتن نن تق baiek","دالم رهيم bundo ma-nganduang.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164947,"اݢوڠ سمبورن دباوا ناءيق","کودا برلاري ماسوق کامڤوڠ","اونتوڠ سورتن تيدق باءيق","سجق د رهيم بوندا کاندوڠ.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164948,"اه Liew ڤرانقن جڤون","مڠمبڠ بوڠا د دالم چاون","براڤ باڽق بوڠا د تامن","ساتو بوات ممبري راون", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164949,"اه ماله ايکن ترکيلت","Mengapatah تيدق dijalakan","اد ماله کاکق برنية","Mengapatah تيدق دکاتاکن؟", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164950,"اه Tee ک کبون ممبواڠ سيڤوت","د کامڤوڠ چينا د Kunak جاي","باݢاي امبون د هوجوڠ رومڤوت","داتڠ سينر هيلڠله اي.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164951,"اهلي ڤرڠ دري kuratan","دالم ڤراهو اورڠ داڤتي","اڤ داتڠله بيار داتڠ","ساي تيدقله تاکوت ماتي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164952,"Ahya imaliya تانمن","Kebarat جوݢ اکن tumboh-nya","دونيا اين دونيا ڤينجمن","Akherat جوݢ اکن sunggoh-nya.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164953,"Aia ado ڤاسڠ suruiknyo","Kaadaan ماءنسي tiado tatapnyo","کوق kayo تق تاتڤ د kayonyo","د ساتو maso bansaik کوق tibo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164954,"Aia Bangih Gunuang Pincuran","Ka Bangko جالن رڠ ka ناتل","Manangih د lapiak katiduran","Aia mato cucua ka banta", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164955,"Aia Bangih Gunuang Simungkuak","Karimbo bapikek بالم","اتي bangih buliah dibujuak","اتي ibo ماکن د دالم", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164956,"اءير Bangih ݢونوڠ Simungkuak","ک ريمبا مميکت بالم","هاتي بڠيس بوليه د بوجوق","هاتي هيبا makannya د دالم", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164957,"Aia Bangih kualo تانڠ","Rajo Utuih ڤولڠ manari","Manangih maubuang بانڠ","بانڠ ka putuih anyo لاي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164958,"Aia Bangih kualanya تنڠ","راج Utuih ڤولڠ مناري","مناڠيس مڠهوبوڠکن بنڠ","بنڠ اکن ڤوتوس سبنتر لاݢي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164959,"Aia Bangih ڤنچورن butun","Jauah taluaknyo Kampuang ڤادڠ","Itam manih rambuik basusun","ڤنداي mambujuak اتي داݢڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164960,"Aia Bangih pasa bajento","Batirai balangik-langik","Itam manih tangguanglah doso","Sabarek بومي jo langik", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164961,"Aia Bangih ڤاسر berjenta","برتيراي برلاڠيت-لاڠيت","هيتم مانيس تڠݢوڠله دوسا","سبرت بومي دان لاڠيت", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164962,"Aia Bangih pasianyo nyato","نمڤق نن دري ڤولاو ڤنجڠ","Ciek ڤون indak cindua mato","مينتق salamat umua ڤنجڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164963,"Aia Bangih ڤاسيرڽ ڽات","تمڤق دري ڤولاو ڤنجڠ","Satupun تيدق چيندور مات","مينتا سلامت عمور ڤنجڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164964,"Aia ba-riak دالم sumua","Di-aru انق سي دڠ توان","ݢادڠ mukasuik بينتڠ timua","اندق ba-suo دڠن بولن.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164965,"Aia bariyak tando تق دالم","Aia bakuncang tando تق punuah","Alemu ditaruah بارو saganggam","تاڤي maota babunyi ampuah", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164966,"Aia چوچورن atok","Turunnyo ka palambahan juo","تيڠکه لاکو mandeh jo باڤق","Manurun juo ka anaknyo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164967,"Aia دالم batambah دالم","هوجن د هولو تق kunjuang taduah","هاتي dandam batambah dandam","Dandam د رنتاو baok mangaluah", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164968,"Aia dicancang indak ka putuih","Babantahan اورڠ badunsanak","حکوم dunsanak indak کن hapuih","نامون dunsanak تاتڤ bunsanak", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164969,"Aia دمينوم raso دوري","ناسي دماکن raso sakam","ديک sangaek tahibo هاتي","ڤاته salero ramuak د دالم", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164970,"Aia disauak rantiang د ڤاته","عادت اورڠ dituruik-i","بومي دڤيجق rantiang دڤاته","د ma nagari ka بوڽي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164971,"Aia ݢادڠ باتو basibak","Musuah داتڠ اورڠ bakuak","نن luko juo نن manyiuak","راسن ميڽق kumbali ka ميڽق", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164972,"Aia janiah هيجاو mambayang","Pamenan Cati رڠ Guligo","Satitiak aia دالم ڤينڠ","د sinan bamain ايکن rayo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164973,"Aia janiah ikannyo جينق","کوروڠ kampuang امان santoso","ايلوق مرتبت رومن ڤون رانچق","نن gadih-gadih نن mudo-mudo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164974,"Aia janiah pincuran gadiang","تڤين انق puti-puti","ڤولڠ ڤاي bairiang-iriang","Disauak aia dangan کندي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164975,"Aia janiah sayaknyo لنداي","جالن rayo تيتين باتو","Barundiang cadiak دڠن ڤنداي","Paham نن duo جادي ساتو", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164976,"Aia jo aia kudian basatu","نن سمڤه katapi juo","Salisiah safamili kito mambantu","اورڠ baelok tasisiah kito", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164977,"Aia mato jatuah ka paruik","Aia mato jatuah ka دالم","سوسه sulik تق suko manyabuik","Dipikua surang سياڠ jo مالم", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164978,"Aia نن تانڠ ijan disangko","Indak ado babuayo","اورڠ pandiam ijan disangko","Salalu اورڠ baiak sajo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164979,"Aia نن تانڠ ka muaro","Buayo ݢادڠ maunyikan","Padangnyo laweh baranjano","هريماو campo bakuliaran", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164980,"Aia نن تانڠ mahanyuikkan","تيڠݢي alemu رندهله هاتي","Alemu ڤادي نن tapakaikan","کيان runduak karano barisi", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164981,"Aia satalam duo تالم","Tingga sataun رڠ tapisi","بادن tasintak tangah مالم","Dipaluak banta دتاڠيسي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164982,"Aia sa-titiek دوا titiek","Tumbuah تينداون tigo کاکي","کامي sa-pantun talua itiek","Kasieh ايم mangko man-jadi.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164983,"Aia سوسو dibaleh","Jo aia tubo","Sagalo kabaikan dibaleh","Jo buruak sajo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164984,"Aia taganang د جاجرن","ڤادي دتانم سوتان Mudo","Tagamang کامي ditinggakan","کامي biaso رامي juo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164985,"Aie Bangih جالن ka تيکو","Basimpang جالن ka Sintuak","بواه manih باءون katuju","سايڠ د دالم batumbuluak", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (164986,"Aijam برکوکوق د اتس دارت","ڤاݢر bamboe tanem بيدارا","Darie doenia sampe achirat","کيت idoep sarie soedara", 4, 6);
