INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165386,"الله هوما ماليم توبة","عبارت کايو سڤوهون labat","هيدوڤ sangsara ماتي ڤون لمبت","ماچم ڤڽاکيت مننتي اوبت", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165387,"الله ايت جوݢ يڠ اسا","بوات کامي سݢالا بڠسا","Celebis اين ڤولا kejadianku","دري ايبو دان باڤکو", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165388,"الله ايت مها اسا","تيدق اد ڤرمولاءن دان تياد کسودهن","ماءنسي سموا اکن بيناس","ماس ساج يڠ منجادي ڤننتوان", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165389,"الله جاديکن saraba ampat","شريعة tharikat hakekat ma'rifat","منجادي ساتو دالم خلوة","راسڽ نعمت تياد ترسورت", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165390,"الله ساج يڠ بݢيتو","Selainya اداله makhlok","تنڤا اݢام هيدوڤ تق مننتو","ڤراڠاي ڤون چوکوڤ بوروق", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165391,"الله تعالى توهن يڠ اسا","منجاديکن مماکن سکالينڽ","بارڠ سياڤا هندق  ترماس","اخلاسکن عبادة کڤدڽ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165392,"الله اوچڤن ليده","ربي ڤڠاکوان هاتي","Abdullah منچاري الله","الله دچاري تق سمبوڽي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165393,"الماري بوروق هيلڠ کونچي","کونچي دبواڠ د ساوه ڤادي","کاسيه سايڠ دبالس بنچي","ميسکين ايموسي ميسکين بودي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165394,"القرءان د اتس ڤتي","ڤتي دليليت بسي واج","همبا برجنجي د دالم هاتي","چوکوڤ نکاه سکالي ساج.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165395,"الو الو د کوالا ليڠݢي","د هارو سامبر sebla prau","سودا تاو بندا يڠ تيڠݢي","کالو تق chobak بيلا کن تاو", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165396,"الو الو د تڤي باکت","Membawak اڠين د pantay راج","کالو اد برسام دکت","ساکيت ڤنيڠ bolay منجاݢ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165397,"الو برتيڠکه دڠن لسوڠ","ڤادي tumbah ايم يڠ کڽڠ","کيت bertelaga سام سکامڤوڠ","عاشيق بربنته اورڠ لاءين سنڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165398,"الو limpato dipabulek","Baralun-alun تيڠکه bunyinyo","Painyo duo tingga ciek","نامون بيلڠن sakitu juo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165399,"الو٢ مماکن توندا","تالي دتاريق تاهن سلمبر","کالاو تق mau ڤد اديندا","باءيق kubalik مناهن صبر.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165400,"الو٢ مماکن توندا","تالي دتاريق تاهن سلمبر","کالاو تق mau ڤد اديندا","باءيق کو باليق مناهن صبر", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165401,"الو-الوان راکن سوده دتريما","سموݢ دعاء دبرکتي الله تعالى","سڤاکت سهلوان ايت يڠ کو ڤينتا","ممرتبتکن لاݢي UKM د ڤرسادا دنيا", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165402,"Aluan د tontong برݢمبر burong","سرتا لاجو haylo ڤارس ڽا","بادن bertua الله منولوڠ","Chukop دڠن هرتا بندا ڽا", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165403,"Aluih lumek saik timbakau","Diisok jan ريڠن٢","Buruang جينق تيدق tacakau","له inggok د تاڤق تاڠن", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165404,"Aluih turiahnyo ڤندن singkia","Dilipek لالو د pakalang","Manih muluiknyo inggan bibia","اتي نن bulek mambalakang", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165405,"الون bagigi له manggigik","الون bakuku له نق manggawik","بق عبارت pajabat الون babisuluik","الون tantu bakuaso له نق maracik", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165406,"الون bakilek له bakalam","بولن له ganok تيݢ puluah","الون diliyek اله paham","Sarupo جيمت د دالم tubuah", 4, 6);
