INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165410,"الون baranak له دتيمڠ","د sinan hiduik mangko bedo","الون tantu labo ka داتڠ","اله dimabuak kiri-kiro", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165411,"الون bataji له نق bakukuak","ايم جنتن نن ka gadang-gadangan","عبارت رڠ mudo basipat gaduak","Alemu الون kauju-ujuan", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165412,"الون dianju له tataruang","Alamt بادن ka binaso","مولاءي karajo الون lansuang","Ado هالڠن نن manimpo", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165413,"الون دايمباو اله داتڠ","الون disuruah اله ڤاي","باڤق mandeh bahati sanang","کالاو انق leh mangarati", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165414,"الون dikinyam له maraso","Raso نن jimek دالم tubuah","الون disuok له badaso","کالاو disuok نق batambuah", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165415,"الون dipanjek asok کوماين","تيڠݢي اله ݢادڠ نن بالون","عبارت رڠ mudo pulo dikatokan","Salamo hiduik babini بالون", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165416,"الون duduak اله maunjua","Indak baagak bajangkokan","سيڤت pandorong سيڤت تق batua","Kudian بارو جادي sasalan", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165417,"الون ݢلورا gumpal-gumpalan","اومبق براولق هيڠݢ کوالا","سڤاکت مسرا منمبه عملن","سام مڠيلق معصية ترچلا", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165418,"الون musik دڠن ايراما","برلاݢو دالم راس","کݢمبيراءن سڤرتي اݢام","جاڠن coba menganalisa", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165419,"الون ڤاي له babaliak","اݢق٢ ambiak ka bicaro","Mamareso کورڠ salidiak","Bapacik indak د نن nyato", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165420,"الون tekilek اله takalam","بولن له ganok tigo puluah","الون diliek اله bakinyam","Raso له سمڤاي دالم tubuah", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165421,"الون٢ ݢلومبڠ جاتي","الون sampei موارا selalang","مينتا tulong مڠوبت هاتي","هاتي Loksana الون ݢلومبڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165422,"الونن بيولا مڠوسيق هاتي","لاݢو دامق ايراما دهولو","ماساکن ڤولا رومڤوت نق ماتي","کالاو ده سمق اورڠ تق لالو", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165423,"الونن ݢوريندم هاتي ترتاون","ماور ترلارڠ ايدامن کيران","نوراني دأندم meranggih ݢوناون","ايمڤين دکارڠ gelodaknya مان؟", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165424,"الور کلادي د مقيم Chuping","چامڤق کاءيل برتالي بنڠ","کالاوله جادي د موسيم مڠمڤيڠ","Kuhantar واکيل اونتوق ممينڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165425,"الور سنا جالن ملينتڠ","انق چينا برجالن کاکي","اڤ ݢونا يڠ سڠݢول لينتڠ","يڠ سڠݢول دودوق ايلوق لاݢي", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165426,"الور٢ منجادي لوبوق","تيلور تونتوڠ براڤيت دوا","بيار هنچور manjadi بوبوق","اصل seuntung کيت بردوا", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165427,"Alus alus larek د raot","ڤاڤن د تڤي bersangkot plamin","داتڠ اروس tarek ka laot","ڤوتر کمودي mengikot اڠين", 4, 6);
