INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165429,"امان دان اه سيڠ د تاهون تيݢ","مريک برکاون دڠن سي باب","بهاي تيدق داڤت ددوݢ","موڠکين برلاکو سچارا تيبا٢", 4, 6);
