INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165441,"امت ڤوتيه بوڠا ملاتي","بوڠا سونتيڠن putri بايو.","جاڠن توان مرنده هاتي","بوڠا کرامت تق موڠکين لايو.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165442,"Ambacang د ateh bukik","Bagolek لالو ka ilalang","Bacancang kilek ateh اڠين","Guruah manaruah اڠين لايڠ.", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165443,"Ambacang د بوکيت تيڠݢي","Jatuah sabuah ka subaliak","Bajalan ajo د بولن کيني","موسيم pabilo ka babaliak", 4, 6);
