INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165445,"Ambacang sabuah bulek","دماکن sadidiah manih","اورڠ ڤادڠ bakirim surek","Dibaco سادڠ manangih", 4, 6);
