INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165450,"Ambe' کن کايو اوده دتاره","اونتوق د بوات لنتاي توڠکڠ","لاءين يڠ ساله لاءين يڠ د ماره","باليق ابه kesuppanan سورڠ", 4, 6);
INSERT INTO pantun_fts (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (165451,"Ambiak اڤي ڤڠݢڠله لوکن","انق rajo ڤولڠ manjalo","Iduik ماتي د تاڠن توان","تيدق کامي duo bicaro", 4, 6);
